import React from 'react';
import { Link } from 'react-router-dom';

import { Menu } from 'antd';

const NavBar = () => {
	const clicked = () => {
		console.log('CLICKED!');
		<Link to='/coffee' />;
	};

	return (
		<div>
			<Menu mode='horizontal'>
				<Menu.Item onClick={() => clicked()}>Home</Menu.Item>
				<Menu.Item onClick={() => clicked()}>Coffee</Menu.Item>
				<Menu.Item onClick={() => clicked()}>About</Menu.Item>
			</Menu>
		</div>
	);
};

export default NavBar;
